import Info from "./Info";
import Nav from "./Nav";

function App() {
  const friends = ["Mars", "Jane", "Nick"];
  const 男 = "Male";

  return (
    <div>
      <Nav />
      <Info name={friends[0]} age={16} 性別={男} />
      <Info name={friends[1]} age={17} 性別={Number("男")} />
      <Info name={friends[2]} age={20} 性別={Number("男")} />
    </div>
  );
}

export default App;
